import styled from 'styled-components';

const Container = styled.div`
width: 100%;
height: 60px;
/* background-color: #f3f3f3; */
background-color: #ffffff;
/* border-top: 1px solid #e6e6e6; */
-webkit-box-shadow: 0px 8px 23px 9px rgba(0,0,0,0.5); 
box-shadow: 0px 8px 23px 9px rgba(0,0,0,0.5);
position: sticky;
z-index: 100;
bottom: 0;
left: 0;
display: flex;
align-items: center;
justify-content: space-between;
overflow-y: hidden; 
overflow-x: scroll; 
 &::-webkit-scrollbar {
    display: none;
 }`;

type Props = {}

const menuItems = [
    {
        name: "profile",
        icon: "person"
    }
]

const Footer = (props: Props) => {
    return (
        <Container>
            <span className="material-symbols-outlined">search</span>

        </Container>
    )
}

export default Footer
